const Testimonials = () => {
    return <Slider>
        <div className="testimonial py-4 px-3">
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolorem adipisci beatae enim at voluptatem reprehenderit, eaque doloremque quibusdam error omnis fuga sapiente eius ullam quo nostrum a voluptate architecto ut?</p>
